result:
.menu-list {
  .table-icon {
    vertical-align: middle;
    font-size: 16px;
  }
  .JNPF-common-layout-main {
    padding: 0;
  }
  .menu-tab {
    height: 100%;
    >>> .el-tabs__content {
      padding: 0;
      height: calc(100% - 40px);
      .box {
        flex: 1;
        height: 100%;
        overflow: hidden;
        display: flex;
        flex-direction: column;
        padding-bottom: 10px;
      }
    }
  }
}
.flow-form-main {
  .el-form {
    padding-top: 0;
  }
  >>> .el-tabs__header {
    padding: 0;
  }
}

.tabs-box {
  >>> .el-tabs__nav:first-child {
    margin-left: 20px !important;
  }
}
.title {
  font-weight: bold;
  line-height: 36px;
  font-size: 14px;
}

.px-20px {
  padding: 0 20px;
}
.content {
  min-height: 20px;
  margin-bottom: 10px;
  color: #606266;
  font-size: 14px;
  span {
    position: relative;
    padding-right: 20px;
  }
  span:not(:last-child) {
    &::after {
      content: '';
      position: absolute;
      top: 1px;
      right: 10px;
      width: 1px;
      height: 15px;
      background: #606266;
      z-index: 1;
    }
  }
}
.no-data {
  height: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
}
